#返回第二个列表中的元素在第一个中的下标，没有用-1代替
def getIndexFromList(_list1, _list2):
    _list_index = []
    for _index in _list2:
        try:
            result = _list1.index(_index)
        except:
            result = -1
        _list_index.append(result)
    return _list_index    

#去掉list中每个元素前后的单双引号
def delQuotes(_list):
    clean_list = []
    for str in _list:
        str_new = str.replace("'","").replace('"','').replace("“","").replace("”","").replace("‘","").replace("’","")
        clean_list.append(str_new)
    return clean_list
    
